import React, {useState} from 'react';
import ImportButton from './ImportButton';

const ImportFrame = () => {
    const [buttonChange, setButtonChange] = useState(1);

    const handleButton1 = ()=>{
        setButtonChange(1);

    }

    const handleButton2 = ()=>{
        setButtonChange(2);

    }

    return (
        <div className="mt-5 grid grid-cols-6">
            {/* <div className="col-span-1 mt-5">
                <button className={
                    "btn w-36 ml-4 " + (buttonChange==1 ? 'btn-secondary':'btn-primary')
                } onClick={handleButton1}>Dữ liệu tĩnh</button>
                <button className={
                    "btn w-36 ml-4 " + (buttonChange==2 ? 'btn-secondary':'btn-primary')
                } onClick={handleButton2}>Dữ liệu động</button>

            </div> */}
            {buttonChange==1 && <div className="grid grid-cols-3 col-span-3 border-l-8 border-gray-500 rounded-lg">
                <div className='col-span-1'><ImportButton elementName="Thông tin địa lý"/></div>
                <div className='col-span-1'><ImportButton elementName="Khoảng cách"/></div>
                <div className='col-span-1'><ImportButton elementName="Các loại bệnh dịch"/></div>
            </div>}
            {buttonChange==2 && <div className="grid grid-cols-3 col-span-3 border-l-8 border-gray-500 rounded-lg">
                <div className='col-span-1'><ImportButton elementName="Số lượng nhiễm"/></div>
                <div className='col-span-1'><ImportButton elementName="Số lượng hồi phục"/></div>
                <div className='col-span-1'><ImportButton elementName="Số lượng tử vong"/></div>
                <div className='col-span-1'><ImportButton elementName="Cấp độ dịch"/></div>
                <div className='col-span-1'><ImportButton elementName="Số lượng vật tư y tế"/></div>
                <div className='col-span-1'><ImportButton elementName="Khả năng cung ứng VTYT"/></div>
            </div>}
        </div>
    );
};

export default ImportFrame;
